//Import components and css
import Card from "./Card";
import ExpenseDate from "./ExpenseDate";
import ExpenseItem from "./ExpenseItem";
import "../css/Expenses.css";

//Expenses component in arrow method
const Expenses = (props) =>
{
  let expenses = props.expense;
  let expense;
  for(let i = 0; expenses.length < i; i++)
  {console.log(expenses[i].date);
    expense += <Card className="expenses"> <ExpenseDate date={expenses[i].date}/> <ExpenseItem title={expenses[i].title} amount={expenses[i].amount} id={expenses[i].id}/> </Card>
  }

  //Returns Card component container with inside ExpenseDate and ExprenseItem components. 
  //At ExpenseDate and ExprenseItem components pass date, title and amount through props.expense
  //which I previously passed from the App component
  return (
    <div>
      {expense}
    </div>
    
  );
}


//Export component
export default Expenses;
